VALUES ('8718836393303', 'OMEGA 3', 'Le poisson peut parfois contenir des substances toxiques, car l\'eau des mers peut être contaminée et ces substances se retrouvent dans le poisson. C‘est aussi la raison pour laquelle les femmes enceintes ne sont pas autorisées à manger (trop) certaines espèces de poissons pendant la grossesse. L‘avantage d\'un complement alimentaire a base d\'huile de poisson de haute qualité est que cette huile de poisson est purifiée. L\'huile de poisson de qualité supérieure Omega-3 d\'Ocean\'s Essentials contient une huile de poisson très pure strictement contrôlée pour la teneur en PCB, en dioxines et en métaux lourds. L‘huile de poisson est produite uniquement après que l‘huile de poisson a satisfait a toutes les exigences légales. En outre, chaque lot après la production est a nouveau analyse par un laboratoire indépendant afin de garantir la qualité supplémentaire. L\'huile de poisson de qualité supérieure Omega-3 Or de Ocean\'s Essentials contient 1 000 mg d‘huile de poisson pure par capsule, dont 180 mg d‘EPA et 120 mg de DHA. Une petite quantité de vitamine E a également été ajoutée . Elle  agit comme un antioxydant pour protéger les acides gras contre l\'oxydation. La vitamine E a également été scientifiquement prouvée pour aider a protéger les cellules saines.', 'https://static.openfoodfacts.org/images/products/871/883/639/3303/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '4.4', '0', '0', '', '1');

